import React, { Component } from "react";
import { NavbarConsumer, NavbarProvider } from "./NavbarContext";

class Navbar extends Component{

    render(){
        return (
            <NavbarConsumer>
                {(navTarget) => {
                    return (
                        <ul>
                            {Object.keys(navTarget).map(
                                key => 
                                <li key={key}>
                                        <a className="navbar-Link" href={navTarget.Target[key]}>=>{navTarget.Item[key]}</a>
                                </li>)}
                        </ul>
                    );
                }}
            </NavbarConsumer>
        );
    }

}

export default Navbar;
